import React, { Component } from "react";

class Dashboard extends Component {
    render(){
        return(
            <div className="wrap-content home">
                <div class="content-title">
                    <div class="flex flex-baseline flex-space">
                        <div>
                            <h1>Dashboard</h1>
                            <h2>Você está no painel principal</h2>
                        </div>
                        <div class="filter-admin">
                            <select name="filter_date" id="" class="select-filter-admin select-filter-date">
                                <option value="day">Diário</option>
                                <option value="week" selected>Semanal</option>
                                <option value="month">Mensal</option>
                            </select>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Dashboard;
